import React, { Component } from 'react'; 
import { Label } from 'semantic-ui-react';
import inventory from './inventory.ES6';

class ViewOrder extends Component {
  constructor(props) {
    super(props);
  }

    render() {
      const inventory = this.props.inventory;
      let salad = (this.props.order);
      let foundation = salad.map((id) => id.foundation);
      console.log(foundation);
      let protein = salad.map((id) => Object.entries(id).filter(
        (obj) => obj[0] ==='protein'
      ));
      let extra = salad.map((id) => Object.entries(id).filter(
        (obj) => obj[0] ==='extra'
      ));
      let dressing = salad.map((id,i) => Object.entries(id).filter(
        (obj) => obj[0] ==='dressing'
      ));
      return (
      <div className="container">
      <table class="table">
          <thead>
            <tr>
              <th scope="col">#</th>
              <th scope="col">Foundation</th>
              <th scope="col">Protein</th>
              <th scope="col">Dressing</th>
              <th scope="col">Extras</th>
            </tr>
          </thead>
          <tbody>
         {salad.map((id,e)=> 
          <tr> <th scope="row">{e}</th> 
          <td> {foundation}</td>
          <td> {protein}</td>
          <td> {extra}</td>
          <td> {dressing}</td>
          </tr>
         )}
          </tbody>
      </table>
      <button className="btn btn-primary" >Skapa  best√§llning</button>
      </div>
      )
    }
}

export default ViewOrder;
